const e=JSON.parse(`{"key":"v-5d6f65e6","path":"/code/2020-04-08-Remove-Duplicates-from-Sorted-Array.html","title":"Remove Duplicates from Sorted Array","lang":"zh-CN","frontmatter":{"title":"Remove Duplicates from Sorted Array","description":"Given a sorted array nums, remove the duplicates in-place such that each element appear only once and return the new length. Do not allocate extra space for another array, you must do this by modifying the input array in-place with O(1) extra memory.","tag":["TIQ"],"date":"2020-04-08T00:00:00.000Z","article":false,"category":"algorithms","head":[["meta",{"property":"og:url","content":"https://yinheng.me/code/2020-04-08-Remove-Duplicates-from-Sorted-Array.html"}],["meta",{"property":"og:site_name","content":"Best Intention"}],["meta",{"property":"og:title","content":"Remove Duplicates from Sorted Array"}],["meta",{"property":"og:description","content":"Given a sorted array nums, remove the duplicates in-place such that each element appear only once and return the new length. Do not allocate extra space for another array, you must do this by modifying the input array in-place with O(1) extra memory."}],["meta",{"property":"og:type","content":"website"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-06-26T04:24:55.000Z"}],["meta",{"property":"article:author","content":"Maple Yin"}],["meta",{"property":"article:tag","content":"TIQ"}],["meta",{"property":"article:published_time","content":"2020-04-08T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2023-06-26T04:24:55.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"WebPage\\",\\"name\\":\\"Remove Duplicates from Sorted Array\\",\\"description\\":\\"Given a sorted array nums, remove the duplicates in-place such that each element appear only once and return the new length. Do not allocate extra space for another array, you must do this by modifying the input array in-place with O(1) extra memory.\\"}"]]},"headers":[],"git":{"createdTime":1687753495000,"updatedTime":1687753495000,"contributors":[{"name":"Yin Heng","email":"yinheng@kuaishou.com","commits":1}]},"readingTime":{"minutes":1.25,"words":375},"filePathRelative":"code/2020-04-08-Remove-Duplicates-from-Sorted-Array.md","localizedDate":"2020年4月8日","excerpt":"<blockquote>\\n<p>Given a sorted array <em>nums</em>, remove the duplicates <a href=\\"https://en.wikipedia.org/wiki/In-place_algorithm\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\"><strong>in-place</strong></a> such that each element appear only <em>once</em> and return the new length.</p>\\n<p>Do not allocate extra space for another array, you must do this by <strong>modifying the input array <a href=\\"https://en.wikipedia.org/wiki/In-place_algorithm\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">in-place</a></strong> with O(1) extra memory.</p>\\n<p><strong>Example 1:</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>Given nums = [1,1,2],\\n\\nYour function should return length = 2, with the first two elements of nums being 1 and 2 respectively.\\n\\nIt doesn't matter what you leave beyond the returned length.\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>Example 2:</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>Given nums = [0,0,1,1,1,2,2,3,3,4],\\n\\nYour function should return length = 5, with the first five elements of nums being modified to 0, 1, 2, 3, and 4 respectively.\\n\\nIt doesn't matter what values are set beyond the returned length.\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>Clarification:</strong></p>\\n<p>Confused why the returned value is an integer but your answer is an array?</p>\\n<p>Note that the input array is passed in by <strong>reference</strong>, which means modification to the input array will be known to the caller as well.</p>\\n<p>Internally you can think of this:</p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>// nums is passed in by reference. (i.e., without making a copy)\\nint len = removeDuplicates(nums);\\n\\n// any modification to nums in your function would be known by the caller.\\n// using the length returned by your function, it prints the first len elements.\\nfor (int i = 0; i &lt; len; i++) {\\n    print(nums[i]);\\n}\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div></blockquote>"}`);export{e as data};
